    true,nt"url": null,nt"notes": "Zonge Geosciences, Inc. performed a magnetotelluric
    (MT) survey for the Glass Buttes Project at the request of Ormat Technologies Inc.
    during the period of 7 October 2010 to 8 November 2010.  This report provides the
    deep electromagnetic data and methods that were used to assist Ormat Technologies
    in assessing potential geothermal resources in the area.nnTensor magnetotelluric
    data were acquired at 30 stations in the eastern survey area and array MT data were
    acquired along one line, 6.8 kilometers in length in the western survey area. The
    survey area is located in Lake County, Oregon and lies within the Glass Butte and
    Hat Butte, Oregon topographic areas.  ",nt"license_title": "Creative Commons
